    .fromTo(".infoJanAndMaria", 1, {opacity:0}, {opacity:1}, "jan");

    tlInquisition.fromTo(".infoJanAndMaria", 1, {opacity:1}, {opacity:0})
    .add( function(){ document.querySelector(".infoJanAndMaria").style.display = "none"; })
    .add( function(){ document.querySelector(".infoInquisition").style.display = "block"; })
    .fromTo(".inquisition", 0.2, {opacity:0}, {opacity:1})
    .staggerFrom(".inquisitor1", 2, {drawSVG:0}, 0.1, "inquisitor1")
    .staggerFrom(".inquisitor2", 2, {drawSVG:0}, 0.1, "inquisitor1+=2")
    .fromTo(".infoInquisition", 1, {opacity:0}, {opacity:1}, "inquisitor1");

    tlSkyline.fromTo(".infoInquisition", 1, {opacity:1}, {opacity:0})
    .add( function(){ document.querySelector(".infoInquisition").style.display = "none"; })
    .add( function(){ document.querySelector(".infoFleeingAntwerp").style.display = "block"; })
    .fromTo(".skyline", 0.2, {opacity:0}, {opacity:1})
    .staggerFrom(".house1", 2, {drawSVG:0}, 0.1, "house1")
    .staggerFrom(".house2", 2, {drawSVG:0}, 0.1, "house1+=2")
    .staggerFrom(".house3", 2, {drawSVG:0}, 0.1, "house1+=4")
    .staggerFrom(".house4", 2, {drawSVG:0}, 0.1, "house1+=6")
    .staggerFrom(".house5", 2, {drawSVG:0}, 0.1, "house1+=8")
    .fromTo(".infoFleeingAntwerp", 1, {opacity:0}, {opacity:1}, "house1");
    
  }
}
